import React from 'react';
import styled from '@emotion/styled';
import { css } from '@emotion/core';
import terminalpng from '../Images/terminal.png';
const TitleDiv = styled.div `
  z-index: -1;
  position: fixed;
  color: white;
  top: 0px;
  height: 100vh;
  width: 100%;
  display: inline-block;
  font-weight: 400;
  background-color: black;  
`;

const Terminal = styled.div`

`;
const Words = styled.div`

`;
const TopBar = styled.div`
  background-color: grey;
  width: 100%;
  height: 40px;
`;
const dynamicStyle = props => 
  css`
    background-color: ${props.color};
  `
const Dot = styled.span`
  height: 30px;
  width: 30px;
  border-radius: 50%;
  display: inline-block;
  margin: 6px;
  ${dynamicStyle};
`;

function Title() {
  return (
    <React.Fragment>
      <TitleDiv>
        <Terminal>
          <TopBar>
            <Dot color="red"/>
            <Dot color="yellow"/>
            <Dot color="lightgreen"/>
          </TopBar>
          <Words>
          Last Login: Wed Feb 29 22:31:52 on console<break/>

          Gregorys-MacBook-Pro:~ gregoryblood$ ls <break/>

          about            projects        contact

          resume.pdf        email.exe        

          Gregorys-MacBook-Pro:~ gregoryblood$ 

          </Words>
        </Terminal>

      </TitleDiv>
      
      
    </React.Fragment>
  );
}

export default Title;
